const MedalsScroll = (props) => {

    let [ifEarned] = useState(props.ifEarned);

    useEffect(
        () => {
          if (ifEarned) {
            getEarnedMedals();
          }
          else {
            getProgressMedals();
          }
        }, [ifEarned]
      );
    return (
        <div id = "MedalsScroll">
            {props.ifEarned ?
            <p>Earned</p>
            :
            <p>Progress</p>
        }
        </div>
    );
}

export default MedalsScroll;
